import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

function renderApp() {
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById('root')
  );
}
function RenderAppButton() {
  return (
    <button onClick={renderApp}>Запустить приложение</button>
  );
}

ReactDOM.createRoot(document.getElementById('root')).render(<RenderAppButton />);
reportWebVitals();
